INSERT INTO `bus` (`id`, `name`, `country`, `zip`, `description`, `bu_info`, `training_link`, `pos_db_dir`, `pos_archives_dir`, `id_pos_cash_method`, `email_order`, `delivery_header`, `delivery_info`, `welcome_email`, `pushover_device`, `pushover_device_kitchen`, `net_ip`, `humanity_positions`, `cashier_alert_amount_safe`, `cashier_alert_amount_close_min`, `cashier_alert_amount_close_max`, `api_key`) VALUES
(1, 'FR75ARCH', 'FR', 75003, '', 'HANK VEGAN BURGER\n55 rue des Archives 75003 Paris\n+33 9 72 44 03 99\nDirect : +33 9 72 44 68 41\n\nHANK VEGAN PIZZA\n18 rue des Gravilliers 75003 Paris\n+33 9 72 50 33 68\nDirect : +33 9 72 56 68 17\n\nEmail manager : manager-fr75arch@hankrestaurant.com\nEmail questions RH : rh-fr75arch@hankrestaurant.com', '', '/home/cashbkp/1/cashpad/cashpad.db', '/home/cashbkp/1/cashpad/archives/c3c9e76c-30e1-47dd-8375-4d5f37ba87ff', '7DD4A3FB-ADC2-49D9-9EDE-01129023FE37', 'order-fr75arch@hankrestaurant.com', '<span style="font-size: 22px; font-weight: bold; color: #ffab14;">HANK BURGER</span>\r\nAdresse de livraison :\r\n<span style="font-size: 16px; font-weight: bold; color: #ffab14;">55 rue des archives 75003 Paris</span>\r\nS.A.S. HANK\r\nRCS 798983706\r\nAPE 5610C\r\nTVA FR38798983706', '- Livrer uniquement dans les horaires et jours déterminés.\n- Le stationnement est délicat, mais possible sur les places de livraison, au coin de la rue ou en arret sur l''arret de bus (contactez-nous pour que nous venions vous aider pour ne pas quitter le camion). Interdiction de bloquer la rue, nous devons controler les marchandises.\n- Toutes les marchandises sont forcément controlées sans exception AVANT la signature du Bon de transport. Si le livreur ne peut ou ne veut pas attendre, cette mention sera inscrite sur le BDT. Nous n''inscrirons jamais les mentions inutiles "sous réserve de truc et machin..." etc.\n- Merci de récupérer vos palettes, nous ne pouvons pas les stocker. Dans tous les cas, nous ne pouvons pas prendre en charge les frais de palette.\n- Café offert à tous les livreurs sympa! :-)', 'Hello!\nBienvenue chez Hank!\n\nEn vue des prochains services, voici quelques informations.\nNous venons de créer ton espace personnel sur notre plateforme «RMS» accessible ici : http://rms.hankrestaurant.com\nTon login par défaut est prenom.nom puis le mot de passe par défaut à changer est : jaimehank\nSi cela ne fonctionne pas, clique sur "Forgot password" sur la page de login pour obtenir un mot de passe.\nLa bible du fonctionnement du restaurant, le "Hank’s play book" est disponible ici : http://rms.hankrestaurant.com/skills/start/\n\nPour le planning, tu peux le consulter ici : https://hank.humanity.com/\n\nTu as normalement reçu un email te demandant d’activer ton compte.\nIl faut également activer ton email en cliquant sur le lien “Activer mon email” sur la page principale\nTon login est prenom.nom. Si cela ne fonctionne pas, clique sur "Forgot password" sur la page de login pour retrouver ton mot de passe.\nPar défaut, tu es notifié de tes shifts 24h à l''avance puis 1h à l''avance. Tu peux changer cela dans les paramètres de ton compte.\n\nIMPORTANT, si ce n’est pas déjà fait, merci de transmettre AVANT TON PREMIER SHIFT, par email à l''adresse rh-fr69opera@hankrestaurant.com (et pas en reply de cet email), par photo ou scan :\n- ta pièce d’identité\n- si tu n’es pas européen ton document d’autorisation de travail\n- ta carte vitale\n- ton attestation sécurité sociale ou CMU si tu en es bénéficiaire\n- ton attestation de mutuelle personnelle si tu en as déjà une\n- ton IBAN (numéro seulement FR76xxxxx et pas l''image).\n\nCordialement,\n—\nThe Hank dream team', 'FR75ARCH', '', '0.0.0.0', '796796,521151,1351252,1382104,1449377,1458545,1223166', 5, -3, 6000, ''),
