INSERT INTO `checklist_tasks` (`id`, `id_checklist`, `name`, `comment`, `priority`, `active`, `order`, `day_week_num`, `day_month_num`) VALUES
(1, 3, 'Allumer lumieres', '', '3', 1, 100, NULL, NULL),
(2, 3, 'Lever les rideaux\n', '', '1', 0, 200, NULL, NULL),
(3, 3, 'Jeter les bouteilles', 'Au bout de la rue dans le r&eacute;cup&#39; verre juste avant la poste. Laisser une bouteille vide dans le bac le plus en haut pour que l&#39;on comprenne que les bouteilles se mettent ici.', '1', 1, 1860, NULL, NULL),
(13, 3, 'Vérifier stock emballages / couverts. Faire une liste et donner cette liste à la personne qui ouvre la salle du haut. \r\n', 'Emballages : - burger - potatoes - potatoes cheese - cookies - fourchette - cuillère - serviette - sacs - boite salade + Rouleau CB et caisse\r\n', '1', 1, 353, NULL, NULL),
(14, 3, 'Nettoyer, sécher et préparer TOUS les plateaux', '', '1', 1, 2500, NULL, NULL),
(15, 3, 'Vérifier que la lumière vitrine burger est allumée + hotte', '', '1', 1, 1890, NULL, NULL),
(18, 3, 'Vérifier la propreté et mettre en place la salle RDC + la salle du haut\r\n', 'Tables, chaises, consoles à sauces \r\nEntrouvrir un peu les fenêtres\r\nPasser le balai dans la salle RDC après la réception du pain.\r\nNettoyer les vitres de la porte d''entrée + vitrine burger (intérieur / extérieur)  ', '1', 1, 1800, NULL, NULL),
(19, 3, 'V&eacute;rifier WC', 'V&eacute;rifier la propret&eacute;, sol, miroir, lavabo\nV&eacute;rifier stock papier toilette + essuie main&nbsp;', '1', 1, 1850, NULL, NULL),
(20, 3, 'Allumer les fours à 11h15. Lancer les cuissons de steaks et de potatoes.', 'Potatoes : week end : 3 à 4 plateaux de prêts à 12h, semaine : 2 plateaux\nSteaks précuits : week end : 2 plaques, semaine : 1 plaque ', '1', 1, 2000, NULL, NULL),
(21, 3, '<p>\n Lancer musique</p>\n', '', '1', 0, 2100, NULL, NULL),
(51, 3, ' Renouveler les desserts de la cloche à dessert\r\n', ' Mettre les desserts les plus récents en présentation sous la cloche et les plus anciens en vente en premier sur les plateaux', '1', 1, 1890, NULL, NULL),
(52, 3, 'Allumer/Cliquer sur "Ouvert" sur la tablette livraisons Delivroo et indiquer dans "menu" quels sont les produits éventuellement manquant (bionade, dessert...).', '', '3', 0, 1910, NULL, NULL),
(53, 3, 'Rincer et remplir le thermos ', '', '1', 0, 1501, '0,3,5', NULL),
(55, 3, 'Four Merrychef remettre bac a glace dans congélateur avec eau + nettoyage four', '(si pas déjà fait à la fermeture) et nettoyer le four : <br />\n- grille de ventilation à l''arrière <br />\n- cavité intérieur (enlever le socle du fond) ', '3', 0, 2050, NULL, NULL),
(56, 3, 'Mettre a jour le menu (tableau)', 'Vérifier dessert du jour, salade du jour, touriste', '3', 1, 2110, NULL, NULL),
(67, 3, 'Nettoyer Four MERYCHEF ', 'Sortir les deux plaques ainsi que les filtres sur les côtés (à l''interieur du four). Les nettoyer et les passer au lave-vaisselle. Passer l''aspirateur dt un sopalin dans le four pour récupérer les miettes. Nettoyer les marques de cuisson. ', '2', 0, 1950, NULL, NULL),
(68, 3, 'Compter la caisse + mise à jour du fond de caisse + recup cle restaurant\n', '- Compter pièces + billets\n- Dans Cashpad -> Comptabilité -> cliquer sur "Fond de caisse à l''ouverture" et indiqué le montant trouvé\n- Vérifier que la clé du restaurant est sous la partie des pièces dans le tiroir de caisse. Si elle n’y est pas, vérifier si elle se trouve dans la boîte aux lettres et la replacer dans la caisse', '3', 1, 350, NULL, NULL),
(71, 3, '<p>\n Vider seau d''eau (evacuation clim) sous l''évier RDC</p>\n', '', '1', 0, 300, NULL, NULL),
(72, 3, 'NOTER LES RETOURS FOURNISSEURS dans le cahier', '', '1', 1, 1900, NULL, NULL),
(74, 8, 'Allumer les lumières', '', '1', 1, 1, NULL, NULL),
(75, 8, 'Allumer les fours de réchauffe pizza 30 mn avant 12h et VERIFIER que la hotte fonctionne', 'Allumer la hotte si OFF', '3', 1, 7000, NULL, NULL),
(76, 8, 'Allumer et mettre en service les laves-vaisselle', 'Visser le plug/filtre, mettre deux pastilles bleues et jaunes dans le lave-vaisselle, fermer la machine et l''allumer. ', '1', 1, 2500, NULL, NULL),
(77, 8, 'Allumer amplificateur', 'Numéro 14 sur télécommande si pas automatique', '1', 1, 9400, NULL, NULL),
(78, 8, 'Allumer lumière vitrine pizza + salade ', 'Si pas automatique, numéro 7 sur télécommande', '1', 0, 9998, NULL, NULL),
(79, 8, 'Mettre en place la salle', 'Tabourets/chaises/coussins\nMettre gobelets, vérifier le niveau des sauces piquantes et des salières/poivrières', '1', 1, 4000, NULL, NULL),
(80, 8, 'Vérifier les distributeurs de papier et de savon + propreté des WC', 'WC haut + essuie main haut x2\nWC bas + essuie main bas ', '1', 1, 3500, NULL, NULL),
(81, 8, 'Allumer le frigo boissons et la machine à café', '', '1', 1, 2000, NULL, NULL),
(83, 8, 'Mettre en place les pizzas, salades, desserts.', 'Refaire des salades si besoin (besoins env. 40) Attention fifo, les first dans bac de gauche de la saladette.\nRemplir le 3P de pizzas', '1', 1, 6000, NULL, NULL),
(84, 9, 'Eteindre four de réchauffe pizza', '', '3', 1, 1000, NULL, NULL),
(85, 9, 'Fermer les fenetres', 'HAUT : bureau + cuisine + rue x2 + cour x1\r\nRDC : cour ', '3', 1, 9000, NULL, NULL),
(86, 9, 'FERMER LA PORTE DANS WC AVEC VERROU ACCES COURS \r\nVérifier que les poubelles sont rentrées\r\n', '', '3', 0, 30000, NULL, NULL),
(87, 9, 'Protéger les échelles', 'Filmer ou capoter les échelles de pizzas et les rentrer en chambre froide, ainsi que les gastros  à refroidir.\r\néventuellement laissés par l''équipe de cuisine.', '3', 1, 10000, NULL, NULL),
(88, 9, 'Nettoyage des Salles et des WC', 'Nettoyage des salles et WC : nettoyer les tables, les tabourets, avec une éponge et du vinaigre blanc. Secouer les coussins et les placer sur le canapé. Placer les tabourets et chaises sur les tables. Rouler le paillasson et le ranger près de la porte (ne surtout pas l''étendre sur les tabourets et sur les tables). Passer le balai. \r\nLes WC se nettoient au papier jetable et au vinaigre. Passer un coup sur les miroirs, porte-savon, lavabo, poignée de porte et cuvette.\r\n-- Vider et laver à l''aide de vinaigre et papier jetable les balayettes WC et leurs socles. --', '3', 1, 5000, NULL, NULL),
(89, 9, 'Remonter les cartons et cagettes vide', 'Les mettre bien en évidence devant la porte d''entrée pour que cela gène le passage du livreur qui doit (littéralement) tomber dessus', '1', 1, 10500, NULL, NULL),
(90, 9, 'Lave-vaisselle ouvert, enlever le plug blanc en laissant le filtre en place.\r\nLorsque le lave-vaisselle est vide, enlever le filtre, le nettoyer et le rincer dans l''évier. Puis le remettre à sa place sans le plug blanc à laisser dans le panier (afin qu''il se lave aussi). \r\nMettre du vinaigre blanc sur les parois et dans le fond et faire tourner le lave-vaisselle pendant 1 minute afin de le rincer.\r\nOuvrir la porte, remettre le plug, éteindre le lave-vaisselle en appuyant sur le bouton tout à gauche et laisser la porte grande ouverte', '', '3', 1, 3500, NULL, NULL),
(92, 9, 'Mettre le plateau de caisse dans bureau sur coffre et laisser la caisse vide ouverte a fond\r\nBien ranger ordinateur et tablette pour qu''ils ne soient pas visible de la rue', '', '3', 1, 8000, NULL, NULL),
(93, 9, 'Eteindre les lumières\r\n- LABO/SOUS SOL, intérrupteur dans escalier\r\n- RDC numéro 3,4,5,6\r\n- ETAGE numéro 1,2\r\n', 'Télécommande dans tiroir cuisine du RDC à droite de l''évier', '3', 1, 13000, NULL, NULL),
(94, 9, 'Fermer la porte en partant + vérifier fermeture devanture', '', '3', 1, 14000, NULL, NULL),
(95, 9, 'Eteindre frigo boisson', 'Bouton 1/0 face avant, en haut', '2', 1, 1250, NULL, NULL),
(96, 9, 'Clôturer la caisse', '- imprimer les tickets Appel des terminaux CB (action : F > CB EMV/CB CLESS > Appel) : EMV + CLESS pour les DEUX terminaux. Renseigner ces infos sur la fiche papier de fermeture caisse.\r\n- clôturer la caisse sur Cashpad : cliquer sur l''icône Maison en haut à droite de l''écran de caisse, et faire "sortir". Aller dans "comptabilité", puis "cloturer caisse". S''il est écrit "cloture impossible", c''est parce que des tickets sont restés ouverts et empêchent la cloture. Pour les fermer, il faut retourner dans l''onglet de caisse, aller dans "tickets", et cliquer sur "masquer historique" afin de faire apparaitre les tickets restés ouverts. Il faut rentrer dans chaque tickets et les annuler, en indiquant la raison de l''annulation, exemple "ticket non cloturé".\r\n- cash out : laisser 8 billets de 10€ et tous les billets de 5€ dans la caisse et prélever le reste des billets. (s''il n''y a pas assez de billets de 10€ utiliser alors des billets de 20€ pour atteindre la somme de 80€) Compter les billets prélevés et renseigner les infos sur la fiche papier de fermeture caisse.\r\n- fond de caisse : compter à l''aide de la machine la somme des pièces présentes dans le tiroir caisse, ainsi que la somme des rouleaux de monnaie qui s''y trouvent. Compter aussi les billets laissés dans le tiroir caisse. Renseigner ces infos sur la fiche papier de fermeture caisse.\r\n- mettre dans l''enveloppe de caisse : tickets CB, tickets Appel CB, billets prélevés.\r\n- remplir le RMS Cashier Close \r\n- terminer de remplir la fiche papier de fermeture caisse avec le numéro donné par Cashier puis la mettre dans l''enveloppe\r\n- fermer l''enveloppe et la placer dans le coffre sous la caisse (bien vérifier qu''elle est bien tombée dans le coffre!) ', '2', 1, 7000, NULL, NULL),
(97, 8, 'Compter la caisse, enregistrer dans HankCashier\n', '- Compter pièces + billets\n- Dans Cashpad -> Comptabilité -> cliquer sur "Fond de caisse à l''ouverture" et indiqué le montant trouvé', '3', 1, 500, NULL, NULL),
(98, 9, 'Filmer l''alimentaire', 'Protection des denrées : filmer (sans trous) les plaques de pizza, les ranger FIFO dans le frigo 3 portes. Filmer les desserts et les salades, les ranger FIFO dans le frigo 2 portes. Ne pas oublier de filmer les pizzas staff et les desserts non entamés (par exemple tarte choco)', '3', 1, 2000, NULL, NULL),
(99, 9, 'Eteindre la machine à café.', 'Vider le réceptacle à dosettes et laver les parties amovibles.', '2', 1, 1500, NULL, NULL),
(100, 8, 'Fermer porte cuisine etage + bureau ', 'Maintenir fermé pendant que le restaurant est ouvert.', '3', 1, 10000, NULL, NULL),
(102, 9, 'Nettoyage Cuisine RDC', '- Comptoir : nettoyage des surfaces : de haut en bas. Nettoyer au vinaigre blanc et à l''éponge les meubles, présentoir pizza, saladette, plans de travail, portes des frigos, et du lave-vaisselle. Nettoyer aussi les marbres et sols du labo si vous avez utilisé les lieux après le départ de l''équipe de cuisine. ', '3', 1, 4000, NULL, NULL),
(103, 9, 'Remplir les deux frigos boisson', '', '1', 0, 500, NULL, NULL),
(104, 10, 'Remplir les frigos boissons ', 'Et café et thé', '1', 1, 1000, NULL, NULL),
(105, 10, 'Eteindre le four du haut ', '', '3', 1, 500, NULL, NULL),
(106, 10, 'Jeter les cartons et le verre.', 'Ne pas jeter le verre après 20h. \nTasser les poubelles, et les changer si elles sont pleines (notamment les toilettes, vite pleines) ', '2', 1, 2000, NULL, NULL),
(107, 10, 'Vidanger et remplacer les pastilles du lave-vaisselle', '', '2', 1, 3000, NULL, NULL),
(108, 10, 'Nettoyer et remettre en état les dessertes ', 'Débarrasser, vérifier les huiles, sels, poivres ... ', '2', 1, 4000, NULL, NULL),
(109, 10, 'Nettoyage cuisine, planche de découpe, plans de travail, aquarium sol et pompe à bière', '', '2', 1, 5000, NULL, NULL),
(110, 10, 'Passer le balais sur les sols, bien faire le tour des tables et chaises, où s''accumulent les déchets divers. ', '', '2', 1, 6000, NULL, NULL),
(111, 10, 'Vider le bac d''eau sous le frigo 3P, le rincer et le remettre à sa place. ', '', '3', 1, 7000, '5,1', NULL),
(112, 10, 'Faire des petites salades ', 'ATTENTION fifo, les premières dans le bac de gauche de la saladette. Les dater, emprunter la dateuse en bas et la remettre à sa place', '2', 1, 8000, NULL, NULL),
(113, 10, 'Nettoyage WC, miroirs et porte-savons, sol et plinthes\nRefill papiers mains et toilettes\nFaire les WC un par un, les condamner lorsque le sol est encore glissant avec le panneau "Sol glissant, WC disponibles en haut/en bas"', '', '2', 1, 9000, NULL, NULL),
(114, 10, 'Check du linge', 'SORTIR LE LINGE du sèche-linge, ET LE PLIER. Nettoyage du filtre.', '2', 1, 10000, NULL, NULL),
(115, 9, 'Protégez les tablettes', 'Les cacher et les brancher sous la caisse, attention, elles ne doivent pas être visibles de la rue. ', '3', 1, 12000, NULL, NULL),
(116, 9, 'Traiter les poubelles', 'Remplacer les sacs poubelle : faire le tour de TOUTES les poubelles muni d''un rouleau de sacs de 150L et d''un de 50L. Lorsque vous enlevez un sac, remplacez-le immédiatement par un neuf. Si ce n''est pas encore fait, rentrer les poubelles dans la cour silencieusement, les aligner contre le mur. Y mettre les sacs pleins dans la verte, et les cartons dans la jaune. Une fois rentré dans le restaurant, bien refermer les portes derrière soi (loquet + verrou).', '3', 1, 6000, NULL, NULL),
(117, 8, 'Vérifier le bon rangement des poubelles dans la cour ET JETER LE VERRE ET LE CARTON', 'Bien alignées contre le mur, pas de palette, rien par terre.\r\nSi des sacs ne rentrent pas, ils sont cachés. ', '3', 1, 3000, NULL, NULL),
