(120, 9, 'Eteindre les climatiseurs', 'Etage + RDC, télécommande dans le placard des compteurs.', '3', 1, 1750, NULL, NULL),
(121, 8, 'Lire le cahier d''information, et aller voir la cuisine pour s''assurer que vous ayez de quoi faire vos salades et cookies.\r\n', 'Retourner voir la cuisine un quart d''heure avant midi. ', '3', 1, 250, NULL, NULL),
(122, 3, 'Se laver les mains', '', '1', 1, 150, NULL, NULL),
(123, 3, 'Lire le cahier d&#39;information', '', '3', 1, 170, NULL, NULL),
(124, 3, 'Changer les torchons et gérer le linge', 'Descendre le linge sale et lancer une machine. Plier le linge du sèche linge s’il y en a et remonter du linge pour que le placard sous le lavabo soit rempli pour la journée avec des tabliers, des torchons et des maniques', '1', 1, 450, NULL, NULL),
(125, 3, 'Remplir la TODO', 'Faire l''inventaire des toppings, sauce, etc et déterminer les besoins pour la journée', '1', 1, 352, NULL, NULL),
(126, 3, 'Vérifier les reminder à faire ce jour + les noter sur un papier', 'le four doit être aspiré tous les 3 jours, attention à ne pas l’oublier car cela peut prendre feu s’il y a trop de graines de sésame à l’intérieur', '1', 1, 171, NULL, NULL),
(127, 3, 'Allumer le lave-vaisselle\n', 'Mettre les 2 pastilles &agrave; l&rsquo;int&eacute;rieur, le fermer afin qu&rsquo;il puisse se remplir\n', '1', 1, 360, NULL, NULL),
