(131, 3, 'Vérifier que l’intégralité de la todo a été faite, et ranger les bons de livraison dans le classeur. ', '', '1', 1, 2800, NULL, NULL),
(133, 11, 'Checker si todo à faire \r\n', 'avoir en réserve (en plus des gastros et bibs presque pleins dans la saladette, si moins des deux tiers, faire comme s’il était vide pour le décompte)\r\nsteaks : 2 bacs semaine, 3 bacs week-end\r\ntomates : 2 gastros semaine, 3 gastros week end\r\noignons : 1 gastro \r\ncheese : 2 gastros\r\ncornichons : 1 gastro\r\nolives : 1 gastro semaine, 2 week-end\r\npoivrons : 2 gastros\r\nroquette : 2 gastros semaine, 3 week-end\r\noignons frits : 1 sachet\r\nsteaks sans gluten : 1 gastro semaine, 2 week-end\r\npetits pots mayos : 1 seau semaine, 1 et demi week-end\r\nsalade : 4 sachets\r\nAlfalfa : 4 paquets\r\nsauces : 2 TATA, 3 Catcheuse, 4 Touriste, 4 BBQ, 4 rockeuse\r\nsalade coleslaw : 15 semaine, 25 week end\r\nSalade du jour : 10 semaine, 20 week end', '3', 1, 1000, NULL, NULL),
(134, 11, 'Faire des desserts si besoin', 'carrot cake : avoir environ 15 semaine, 40 week end\r\ncookies : avoir environ 15 semaine, 30 week end\r\nDesserts du jour : étage au dessus des potatoes rempli dans le 3P', '2', 1, 2000, NULL, NULL),
(135, 11, 'Remonter les potatoes et en décongeler', 'semaine : 6 cartons (24 sachets) en décongélation\nweek end : 8 cartons (32 sachets) en décongélation', '3', 1, 3000, NULL, NULL),
(136, 11, 'FIFO + couper pains ', 'Réorganiser les boites, les plus anciennes devant, controler les etiquettes.\nCouper tous les pains et remonter le nombre de caisse nécessaire pour que toutes les boîtes soient remplies', '1', 1, 4000, NULL, NULL),
(137, 11, 'Checker les distributeurs à sauce et les remplir si besoin', 'ketchup et vegannaise : minimum les 2 tiers, \nmoutarde : minimum la moitié\nremplir les pots en verre pour les sauces à emporter', '2', 1, 5000, NULL, NULL),
(138, 11, 'Vérifier le stock des emballages', 'potatoes, burgers, serviettes, sacs VAE, fourchettes, cuillères, gobelets et couvercles à thé, café, eau ', '2', 1, 6000, NULL, NULL),
