(140, 11, 'Nettoyer le poste burger', 'Gratter la plaque, ramasser les miettes, passer le balai, nettoyer la vitre si besoin, nettoyer l’étagère des sauces et steaks sans gluten si besoin, nettoyer les côtés en inox si besoin, recharger en emballages burger', '3', 1, 8000, NULL, NULL),
