(157, 4, 'Recharger le frigo 3P avec au moins 8 sachets de potatoes et Faire décongeler des sachets de potatoes en chambre froide', '4 cartons (16 sachets) du dimanche soir au jeudi soir, 6 cartons (24 sachets) vendredi et samedi soir ', '2', 1, 4000, NULL, NULL),
(158, 4, 'Recharger le bac inférieur du frigo 1P avec des pains sans gluten', 'Au moins 2 sachets de 10 pains', '2', 1, 5000, NULL, NULL),
