(161, 4, 'Éteindre les fours turbochef et laisser la porte entrouverte', 'Appuyer sur “BACK” puis “OVEN OFF” ', '3', 1, 8000, NULL, NULL),
(162, 4, 'Éteindre les machines', 'la machine à café (bouton derrière la machine)\nle chauffe frite\nla saladette toppings\nla lumière du frigo boisson client\nla lumière du petit frigo comptoir (éteindre seulement le bouton avec l’ampoule)', '3', 1, 9000, NULL, NULL),
(163, 4, 'Protéger les pains', 'Refermer les bacs de pains, protéger les pains sans gluten et les oignons frits dans les bacs de pains. Il ne suffit pas de les filmer, cela ne les protège pas assez, il faut absolument les mettre dans des boîtes fermées', '3', 1, 10000, NULL, NULL),
(164, 4, 'Ranger tous les gastros et bibs dans les frigos et la CF. Changer les capuchons des bibs utilisés pendant le service. ', 'Refermer tous les gastros de toppings avec des couvercles ou du film alimentaire \r\nChanger les capuchons des sauces utilisées pendant le service\r\nFermer les bacs de steaks natursoy et steaks sans gluten\r\nRanger les gastros à utiliser en priorité dans le 3P', '2', 1, 11000, NULL, NULL),
(165, 4, 'Filmer les desserts', 'Plateau par plateau (ne pas superposer les plateaux avant de les filmer ensemble)\nNe pas oublier les desserts de la cloche à desserts\nRanger tous les carrot cake dans les frigos ou CF\nNe rien superposer sur un plateau de carrot cake', '3', 1, 12000, NULL, NULL),
(166, 4, 'Mettre les distributeurs de vegannaise et les petits pots au frigo', '', '2', 1, 13000, NULL, NULL),
(167, 4, 'Nettoyer le poste burger', 'Gratter la plaque et la nettoyer intégralement à l’intérieur et à l’extérieur, ne pas mettre le côté grattant de l’éponge sur la vitrocéramique \nNettoyer le haut de la saladette topping devant la fenêtre\nNettoyer la fenêtre\nNettoyer la saladette topping (à l’intérieur et en dessous)\nNettoyer la planche en bois\nNettoyer la plancha chauffante (ne pas utiliser le côté grattant de l’éponge)\nNettoyer le mur blanc sous la saladette topping', '2', 1, 14000, NULL, NULL),
(168, 4, 'Nettoyer l’espace derrière le comptoir', 'Nettoyer au dessus, en dessous et les côtés des fours\n Nettoyer les portes des frigos à l’extérieur et à l’intérieur, bien nettoyer les poignées\nNettoyer le chauffe frite, au dessus, à l’intérieur et la partie qui s’enlève : liquide vaisselle et éponge, bien frotter (ne pas hésiter à allumer la lumière pour vérifier)\nNettoyer le comptoir en bois, ne rien laisser trainer (stylos à mettre dans le pots, etc)\nNettoyer l’espace au dessus du lave vaisselle, l’évier, et à droite de l’évier\nChanger les poubelles', '2', 1, 15000, NULL, NULL),
(169, 4, 'Gérer le linge', 'Descendre le linge sale et vérifier qu’il ne reste pas de linge propre et mouillé dans la machine à laver, sinon les mettre dans le sèche linge et lancer le sèche linge\n- sèche linge : enlever filtre pour nettoyer la poussière et bien le remettre\n- NE PAS lancer de machine à laver après 20h !', '1', 1, 16000, NULL, NULL),
(170, 4, 'Remonter les caisses de pains pleines nécessaires au service du lendemain, les caisses de pains vides, les cagettes et les cartons', 'les 3 emplacements doivent être pris par des caisses pleines, les vides doivent être mises dans la salle  \nmettre les cartons et cagettes devant la porte d’entrée pour le livreur de fruits et légumes', '2', 1, 17000, NULL, NULL),
(171, 4, 'Vérifier la bonne fermeture et le bon fonctionnement de tous les frigos et congels', '', '3', 1, 18000, NULL, NULL),
(172, 4, 'Faire la plonge intégralement et la ranger au labo (gastro, bibs, etc)', 'sauf ce qui doit rester en haut (gastro potatoes, gastro emballages potatoes, gastro steaks tampons, pelle potatoes, gastro salade, etc.)', '2', 1, 19000, NULL, NULL),
(173, 4, 'Nettoyer le labo', 'Eponge et vinaigre sur les plans de travail, passer le balais puis la serpillère\nVérifier qu’il n’y a pas de nourriture en dehors de la CF (sachets de potatoes, sauces, etc.) et que les bacs de pains sont bien fermés ou filmés\nVérifier qu’il y a de l’eau dans le réservoir de la CF', '1', 1, 20000, NULL, NULL),
(174, 4, 'Nettoyer la salle du haut et la salle du RDC + sol réserve ', 'Ouvrir les fenêtres en grand pour aérer pendant le nettoyage et bien penser à les refermer après, nettoyer toutes les tables, les bacs des distributeurs à sauce et les 2 consoles, changer les sacs poubelles, mettre tous les coussins sur le canapé, mettre les tables et les tabourets sur les bancs en haut, les chaises sur les tables au RDC, passer le balais AUSSI SOUS LE CANAPÉ, passer la serpillère (bien frotter pour enlever toutes les tâches), fermer les fenêtre du haut', '3', 1, 21000, NULL, NULL),
(175, 4, 'Nettoyer les toilettes + lavabo', 'Nettoyer entièrement l''abattant au vinaigre, les 2 miroirs, le distributeur de papier toilettes, nettoyer la poignée des deux côtés,  changer les 2 poubelles, nettoyer le lavabo, passer le balais, passer la serpillère', '3', 1, 22000, NULL, NULL),
(176, 4, 'Vider le lave vaisselle et le nettoyer, l’éteindre et laisser la porte ouverte', 'Soulever et dévisser la bite et rester appuyer sur start pendant 5 secondes jusqu’à entendre un bruit qui indique que le lave vaisselle se vide\nasperger de vinaigre l’intérieur du lave vaisselle, frotter avec une éponge, sortir le filtre et très bien le nettoyer', '2', 1, 23000, NULL, NULL),
(177, 4, 'Passer le balai et la serpillère derrière le comptoir ', 'Retirer les deux caisses d''emballage afin de pouvoir passer le balai et ne pas laisser de miettes\nNe surtout pas oublier l''espace SOUS L''EVIER : balai et serpillère : retirer la poubelle et les produits de nettoyage afin de passer le balai et la serpillère correctement', '2', 1, 24000, NULL, NULL),
(178, 4, 'Vérifier la fermeture des fenêtres du haut et de la fenêtre du poste burger', '', '3', 1, 25000, NULL, NULL),
(179, 4, 'IL EST 22H55 OU PLUS', '', '3', 1, 26000, NULL, NULL),
(180, 4, 'Eteindre les lumières et fermer la porte en partant', 'Vérifier que la porte est bien fermée en essayant de l’ouvrir \nRegardez vous en train de fermer la porte, visualiser votre action \nEST CE QUE J’AI BIEN FERMÉ LA PORTE', '3', 1, 27000, NULL, NULL),
(181, 4, 'FAIRE LA CAISSE', '- imprimer les tickets Appel des terminaux CB (action : F > CB EMV/CB CLESS > Appel). Renseigner ces infos sur la fiche papier de fermeture caisse.\r\n- clôturer la caisse sur Cashpad : cliquer sur l''icône maison en haut à droite de l''écran de caisse, et faire ''sortir''. Aller dans ''comptabilité'' puis appuyer sur ''clôturer''. S''il est écrit ''clôture impossible'' c''est parce que des tickets sont restés ouverts et empêchent la clôture. Pour les fermer, il faut retourner dans l''onglet de caisse, aller dans ''tickets'' et cliquer sur ''masquer historique'' pour ne faire apparaître que les tickets restés ouverts. Il faut rentrer dans chaque ticket et les annuler et en note écrire la raison de l''annulation. ex : ticket non clôturé.\r\n- cash out : laisser 8 billets de 10€ et tous les billets de 5€ dans la caisse et prélever le reste des billets. (s''il n''y a pas assez de billets de 10€ utiliser alors des billets de 20€ pour atteindre la somme de 80€) Compter les billets prélevés et renseigner les infos sur la fiche papier de fermeture caisse.\r\n- fond de caisse : compter à l''aide de la machine la somme des pièces présentes dans le tiroir caisse, ainsi que la somme des rouleaux de monnaie qui s''y trouvent. Compter aussi les billets laissés dans le tiroir caisse. Renseigner ces infos sur la fiche papier de fermeture caisse.\r\n- mettre dans l''enveloppe de caisse : tickets CB, tickets Appel CB, billets prélevés.\r\n- remplir le RMS Cashier Close \r\n- terminer de remplir la fiche papier de fermeture caisse avec le numéro donné par Cashier puis la mettre dans l''enveloppe\r\n- fermer l''enveloppe et la placer dans le coffre sous la caisse (bien vérifier qu''elle est bien tombée dans le coffre!) ', '3', 1, 2000, NULL, NULL),
