(184, 4, 'NETTOYER TOUS LES PLATEAUX ET LES ETENDRE POUR QU''ILS SÈCHENT', 'Utiliser les étendoirs à plateaux en les posant sur les fours \nMettre un torchon en dessous s''ils sèchent sur le comptoir en bois', '1', 1, 19200, NULL, NULL),
