(193, 3, 'Check Qualité : salade + sauces + topping + desserts', 'Gouter les plus veilles salades\r\nGouter les premières sauces à utiliser\r\nVerifier la fraicheur des toppings de la veille\r\nVérifier la propreté des bouchons de bibs\r\nVerifier le visuel et la qualité des desserts ', '3', 1, 351, NULL, NULL),
