(199, 12, 'Nettoyer et éteindre lave-vaisselle', 'Ouvrir lave-vaisselle et desserrer le plug blanc en le tournant. Vidanger l''eau sale en gardant le filtre. Une fois l''eau entièrement vidée, pulvérisez l''intérieur et la porte de vinaigre blanc, retirer les filtres blancs et les nettoyer manuellement. Refermer la machine et les laisser se rincer deux minutes (automatique). Rouvrir, replacer le filtre et plug, ETEINDRE et laisser ouvert. ', '3', 1, 40000, NULL, NULL),
(200, 12, 'Nettoyer toutes les surfaces (portes, poignées, four ..)', '', '1', 1, 50000, NULL, NULL),
