(225, 3, 'FAIRE CHAUFFER LE CHEESE ET REMUER RÉGULIÈREMENT', 'Brancher le bain-marie, mettre de l''eau jusqu''à la limite ''max'', tourner le bouton jusqu''à ''MAX'' et remplir les deux cuves de cheese (récupérer un seau soit dans le frigo sous bar, soit dans la CF).\r\nSi pas de cheese, demander à la cuisine d''en préparer', '3', 1, 354, NULL, NULL),
