(233, 4, 'Vider le cheese dans un gastro ou un seau, étiquetter avec cheese et la date du jour, faire tremper le bac, nettoyer le bain-marie', 'Mettre le cheese au frigo ou en CF, faire tremper le bac à cheese avec de l''eau très chaude et du liquide vaisselle, nettoyer le contour de la machine', '2', 1, 11100, NULL, NULL),
