(236, 9, 'Vérifiez les frigos RDC', 'Vérifier la bonne fermeture de toutes les portes des frigos ! Chambre froide, 3 portes labo, frigo boissons, frigo salade, congélateurs, 2 et 3 porte RDC, cuisine à l''étage. Eteindre la lumière de la chambre froide (bouton vert du bas à l''extérieur à gauche de la porte).', '3', 1, 10750, NULL, NULL),
