(238, 11, 'Vérifier qu''il y a au minimum une cuve remplie de cheese en semaine et deux le week-end. ', 'La cuisine laisse un ou deux seaux d''avance de fromage déjà préparé en CF.\r\nEn semaine, avoir une cuve pleine à l''interservice, et le week-end, deux cuves pleines. Verser les seaux de cheese dans la/les cuves, verser un peu de lait de soja puis remuer très régulièrement.  ', '2', 1, 5100, NULL, NULL),
