(336, 17, 'Éteindre les machines', 'fours Turbochef\r\nla machine à café (bouton derrière la machine)\r\nle chauffe frite\r\nplancha cuisson steak\r\nplancha prepa burger\r\nsaladette toppings\r\nlumière du bar', '3', 1, 9000, NULL, NULL),
(337, 17, 'Protéger les pains', 'Refermer les bacs de pains, protéger les pains sans gluten et les oignons frits dans les bacs de pains. Il ne suffit pas de les filmer, cela ne les protège pas assez, il faut absolument les mettre dans des boîtes/sacs fermées', '3', 1, 10000, NULL, NULL),
(338, 17, 'Ranger tous les gastros et bibs dans les frigos et la CF', 'Refermer tous les gastros de toppings avec des couvercles ou du film alimentaire \r\nEssuyer les capuchons des sauces\r\nFermer les bacs de steaks natursoy et steaks sans gluten\r\nRanger les gastros à utiliser en priorité dans le 3P', '2', 1, 11000, NULL, NULL),
(339, 17, 'Filmer les desserts', 'Plateau par plateau (ne pas superposer les plateaux avant de les filmer ensemble)\r\nNe pas oublier les desserts de la cloche à desserts\r\nRanger tous les carrot cake dans les frigos ou CF\r\nNe rien superposer sur un plateau de carrot cake', '3', 1, 12000, NULL, NULL),
(340, 17, 'Mettre les distributeurs de vegannaise et les petits pots au frigo', '', '2', 1, 13000, NULL, NULL),
(341, 17, 'Nettoyer le poste burger', 'Gratter la plaque et la nettoyer intégralement à l’intérieur et à l’extérieur, ne pas mettre le côté grattant de l’éponge sur la vitrocéramique \nNettoyer le haut de la saladette topping devant la fenêtre\nNettoyer la fenêtre\nNettoyer la saladette topping (à l’intérieur et en dessous)\nNettoyer la planche en bois\nNettoyer la plancha chauffante (ne pas utiliser le côté grattant de l’éponge)\nNettoyer le mur blanc sous la saladette topping', '2', 1, 14000, NULL, NULL),
(343, 17, 'Gérer le linge', 'Descendre le linge sale et vérifier qu’il ne reste pas de linge propre et mouillé dans la machine à laver, sinon les mettre dans le sèche linge et lancer le sèche linge\n- sèche linge : enlever filtre pour nettoyer la poussière et bien le remettre\n- NE PAS lancer de machine à laver après 20h !', '1', 1, 16000, NULL, NULL),
(345, 17, 'Vérifier la bonne fermeture et le bon fonctionnement de tous les frigos et congels', '', '3', 1, 25500, NULL, NULL),
(346, 17, 'Faire la plonge intégralement et la ranger au labo (gastro, bibs, etc)', 'sauf ce qui doit rester en haut (gastro potatoes, gastro emballages potatoes, gastro steaks tampons, pelle potatoes, gastro salade, etc.)', '2', 1, 19000, NULL, NULL),
(347, 17, 'Nettoyer le labo', 'Eponge et vinaigre sur les plans de travail, passer le balais puis la serpillère\r\nVérifier qu’il n’y a pas de nourriture en dehors de la CF (sachets de potatoes, sauces, etc.) ', '1', 1, 20000, NULL, NULL),
(348, 17, 'Nettoyer la salle du haut et la salle du RDC + sol réserve ', 'Nettoyer toutes les tables, les bacs des distributeurs à sauce et les 2 consoles, changer les sacs poubelles, mettre tous les coussins sur le canapé, mettre les tables et les tabourets sur les bancs en haut, les chaises sur les tables au RDC, passer le balais AUSSI SOUS LE CANAPÉ, passer la serpillère (bien frotter pour enlever toutes les tâches), fermer les fenêtre du haut', '3', 1, 21000, NULL, NULL),
(349, 17, 'Nettoyer les toilettes + lavabo', 'Nettoyer entièrement l''abattant au vinaigre, le miroir, le distributeur de papier toilettes, nettoyer la poignée des deux côtés,  changer les 2 poubelles, nettoyer le lavabo, passer le balais, passer la serpillère', '3', 1, 22000, NULL, NULL),
(350, 17, 'Vider le lave vaisselle et le nettoyer, l’éteindre et laisser la porte ouverte', 'Soulever et dévisser la bite.\r\nAsperger de vinaigre l’intérieur du lave vaisselle, frotter avec une éponge, sortir le filtre et très bien le nettoyer', '2', 1, 23000, NULL, NULL),
(351, 17, 'Passer le balai et la serpillère derrière le comptoir ', 'Retirer les deux caisses d''emballage afin de pouvoir passer le balai et ne pas laisser de miettes\r\nNe surtout pas oublier l''espace SOUS L''EVIER : balai et serpillère : retirer la poubelle et les produits de nettoyage afin de passer le balai et la serpillère correctement', '2', 1, 24000, NULL, NULL),
