(354, 17, 'Eteindre les lumières et fermer la porte en partant', 'Vérifier que la porte est bien fermée en essayant de l’ouvrir \nRegardez vous en train de fermer la porte, visualiser votre action \nEST CE QUE J’AI BIEN FERMÉ LA PORTE', '3', 1, 27000, NULL, NULL),
(355, 17, 'FAIRE LA CAISSE', '- imprimer les tickets Appel des terminaux CB (action : F > CB EMV/CB CLESS > Appel). Renseigner ces infos sur la fiche papier de fermeture caisse.\r\n- clôturer la caisse sur Cashpad : cliquer sur l''icône maison en haut à droite de l''écran de caisse, et faire ''sortir''. Aller dans ''comptabilité'' puis appuyer sur ''clôturer''. S''il est écrit ''clôture impossible'' c''est parce que des tickets sont restés ouverts et empêchent la clôture. Pour les fermer, il faut retourner dans l''onglet de caisse, aller dans ''tickets'' et cliquer sur ''masquer historique'' pour ne faire apparaître que les tickets restés ouverts. Il faut rentrer dans chaque ticket et les annuler et en note écrire la raison de l''annulation. ex : ticket non clôturé.\r\n- cash out : laisser 8 billets de 10€ et tous les billets de 5€ dans la caisse et prélever le reste des billets. (s''il n''y a pas assez de billets de 10€ utiliser alors des billets de 20€ pour atteindre la somme de 80€) Compter les billets prélevés et renseigner les infos sur la fiche papier de fermeture caisse.\r\n- fond de caisse : compter à l''aide de la machine la somme des pièces présentes dans le tiroir caisse, ainsi que la somme des rouleaux de monnaie qui s''y trouvent. Compter aussi les billets laissés dans le tiroir caisse. Renseigner ces infos sur la fiche papier de fermeture caisse.\r\n- mettre dans l''enveloppe de caisse : tickets CB, tickets Appel CB, billets prélevés.\r\n- remplir le RMS Cashier Close \r\n- terminer de remplir la fiche papier de fermeture caisse avec le numéro donné par Cashier puis la mettre dans l''enveloppe\r\n- fermer l''enveloppe et la placer dans le coffre sous la caisse (bien vérifier qu''elle est bien tombée dans le coffre!) ', '3', 1, 2000, NULL, NULL),
