(433, 20, 'Vérifier que les panneaux mis le matin en vitrine enlevés', '', '2', 0, 23000, NULL, NULL),
(434, 20, 'Vérifier qu''il y a au minimum une cuve remplie de cheese en semaine et deux le week-end. ', 'La cuisine laisse un ou deux seaux d''avance de fromage déjà préparé en CF.\r\nEn semaine, avoir une cuve pleine à l''interservice, et le week-end, deux cuves pleines. Verser les seaux de cheese dans la/les cuves, verser un peu de lait de soja puis remuer très régulièrement.  ', '2', 1, 5100, NULL, NULL),
(435, 20, 'BRANCHER LES GUIRLANDES LUMINEUSES RDC ET ETAGE', '', '1', 0, 21100, NULL, NULL),
(436, 21, 'Vérifier stock steaks+toppings+sauces+potatoes+desserts', 'avoir en réserve (en plus des gastros et bibs presque pleins dans la saladette, si moins des deux tiers, faire comme s’il était vide pour le décompte)\r\n', '3', 1, 1000, NULL, NULL),
(437, 21, 'Faire des desserts si besoin', 'carrot cake \r\ncookies\r\nDesserts du jour ', '2', 1, 2000, NULL, NULL),
(438, 21, 'Mettre potatoes à décongeler', '', '3', 1, 3000, NULL, NULL),
(439, 21, 'FIFO + couper pains ', 'Réorganiser les boites, les plus anciennes devant, controler les etiquettes.\nCouper tous les pains et remonter le nombre de caisse nécessaire pour que toutes les boîtes soient remplies', '1', 1, 4000, NULL, NULL),
(440, 21, 'Checker les distributeurs à sauce et les remplir si besoin', 'ketchup et vegannaise : minimum les 2 tiers, \r\nmoutarde : minimum la moitié\r\nremplir les pots en verre pour les sauces à emporter', '2', 1, 5000, NULL, NULL),
(441, 21, 'Vérifier le stock des emballages', 'potatoes, burgers, serviettes, sacs VAE, fourchettes, cuillères, gobelets et couvercles à thé, café, eau ', '2', 1, 6000, NULL, NULL),
(442, 21, 'Remplir le frigo boisson régulièrement \n', '', '2', 1, 7000, NULL, NULL),
(443, 21, 'Nettoyer le poste burger', 'Gratter la plaque, ramasser les miettes, passer le balai, nettoyer la vitre si besoin, nettoyer l’étagère des sauces et steaks sans gluten si besoin, nettoyer les côtés en inox si besoin, recharger en emballages burger', '3', 1, 8000, NULL, NULL),
(444, 21, 'Nettoyer les tables', 'Etage, RDC', '3', 1, 9000, NULL, NULL),
(445, 21, 'Passer le balai partout : 1er étage, RDC, derrière le comptoir, dans les toilettes, et dans la réserve \n', '', '3', 1, 10000, NULL, NULL),
(447, 21, 'Nettoyer le lavabo client, le miroir client et la vitre du frigo boisson', '\n', '2', 1, 12000, NULL, NULL),
(448, 21, 'Nettoyer les toilettes (cuvette, miroir, toiles d’araignées, trou)\r\nVérifier stock essuie mains et papier toilette', '', '3', 1, 13000, NULL, NULL),
(450, 21, 'Lancer machine à laver le linge, sèche linge, plier le linge', '', '1', 1, 15000, NULL, NULL),
(451, 21, 'Sortir les poubelles si besoin', '', '3', 1, 16000, NULL, NULL),
(452, 21, 'Jeter les verres si possible', '', '3', 1, 17000, NULL, NULL),
(454, 21, 'Faire un maximum de reminder et avancer ceux qui sont dans 1, 2, 3 ou même 4 jours', '', '1', 0, 19000, NULL, NULL),
(455, 21, 'Faire la vaisselle, nettoyer et préparer tous les plateaux', '', '2', 1, 20000, NULL, NULL),
(456, 21, 'Nettoyer le sous sol', 'Désinfecter les plans de travail, vider le lave vaisselle et le désinfecter, passer le balai', '1', 1, 21000, NULL, NULL),
(457, 21, 'Vérifier que les clim sont en route si nécessaire.', '', '1', 1, 22000, NULL, NULL),
(459, 21, 'Vérifier qu''il y a au minimum une cuve remplie de cheese en semaine et deux le week-end. ', 'La cuisine laisse un ou deux seaux d''avance de fromage déjà préparé en CF.\r\nEn semaine, avoir une cuve pleine à l''interservice, et le week-end, deux cuves pleines. Verser les seaux de cheese dans la/les cuves, verser un peu de lait de soja puis remuer très régulièrement.  ', '2', 1, 5100, NULL, NULL),
(461, 8, 'HIVER Allumer le chauffage RDC + ETAGE', 'Les télécommandes se trouvent en salle staff pour l''étage, et dans le placard électrique au RDC. Bien les remettre à leurs places. ', '3', 1, 9999, NULL, NULL),
(462, 4, 'Comptabiliser les pertes emballages + nourriture et remplir la fiche perte. ', 'Compter les emballages situés dans le seau sous l''évier, et la nourriture située dans le seau sous le poste burger. Remplir la fiche perte se trouvant dans le trieur bleu. Vider les seaux. ', '2', 1, 12100, NULL, NULL),
(463, 11, 'Comptabiliser les pertes emballages + nourriture et remplir la fiche perte. ', 'Compter les emballages situés dans le seau sous l''évier et la nourriture située dans le seau sous le poste burger et remplir la fiche perte. Vider les seaux. ', '2', 1, 11000, NULL, NULL),
(464, 16, 'Mettre le menu extérieur + la terrasse en place + vérifier la propreté de la terrasse et de l’entrée, passer le balai et jeter un seau d’eau avec du produit qui sent bon', '', '1', 1, 2930, NULL, NULL),
(465, 16, 'Transfèrer le linge de la machine à laver dans le sèche linge et je le met en route ', 'à chaque utilisation enlever les peluches du filtre et vider le réservoir d''eau (celui situé dans la prtie haute du sèche linge) - quand je mets du linge sale dans la machine à laver je pense à retirer tout ce qui pourrait être dans les poches', '3', 1, 180, NULL, NULL),
(466, 18, 'Fermer bureau + salle staff', '', '1', 1, 1950, NULL, NULL),
(468, 16, 'Vérifier la musique', 'Vérifier ampli si éteinte', '3', 1, 2950, NULL, NULL),
(469, 17, 'Rentrer menu extérieur + terrasse', '', '3', 1, 21500, NULL, NULL),
