(1, 'Espece FOND DE CAISSE', 'yes', 1, '7DD4A3FB-ADC2-49D9-9EDE-01129023FE37', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Il s''agit donc de l''argent qui reste dans la caisse uniquement (et donc PAS les billets précédemment prélevés). Compter également les éventuels  rouleaux de monnaie.', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Compter également les éventuels  rouleaux de monnaie.', 1),
(1, 'Espece FOND DE CAISSE', 'yes', 1, '7DD4A3FB-ADC2-49D9-9EDE-01129023FE37', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Il s''agit donc de l''argent qui reste dans la caisse uniquement (et donc PAS les billets précédemment prélevés). Compter également les éventuels  rouleaux de monnaie.', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Compter également les éventuels  rouleaux de monnaie.', 2),
(1, 'Espece FOND DE CAISSE', 'yes', 1, '7DD4A3FB-ADC2-49D9-9EDE-01129023FE37', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Il s''agit donc de l''argent qui reste dans la caisse uniquement (et donc PAS les billets précédemment prélevés). Compter également les éventuels  rouleaux de monnaie.', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Compter également les éventuels  rouleaux de monnaie.', 3),
(1, 'Espece FOND DE CAISSE', 'yes', 1, '7DD4A3FB-ADC2-49D9-9EDE-01129023FE37', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Il s''agit donc de l''argent qui reste dans la caisse uniquement (et donc PAS les billets précédemment prélevés). Compter également les éventuels  rouleaux de monnaie.', 'Entrer le montant du FOND DE CAISSE en espèce, pièces + billets. Compter également les éventuels  rouleaux de monnaie.', 4),
(2, 'CB', 'yes', 1, 'BEE1F7F4-303E-49EC-ACD0-0F5C85D68B30', 'Sur le TPE, appuyer sur "F" puis "CB EMV" puis "APPEL". Puis "F" puis "CB CLESS" puis "APPEL". Inscrivez le total des transactions. Attention, il peut y avoir un autre ticket pour le même jour dans le tiroir caisse, il est à additionner.', '', 1),
(2, 'CB', 'yes', 1, 'BEE1F7F4-303E-49EC-ACD0-0F5C85D68B30', 'Pour imprimer (et envoyer les informations à la banque et donc sécuriser nos transactions CB de la journée) il est très important de procéder de la sorte : \n\nTouche F puis CB EMV puis Appel (le ticket s''imprime)\nPUIS\nTouche F puis CB CLESS puis Appel (le ticket s''imprime)\n\nAttention, cette action est à faire sur LES DEUX TERMINAUX (vous devez avoir 4 papiers imprimés à la fin des manips). Il est possible que les terminaux à un moment pendant le service effectuent d''eux même l''Appel et impriment un ticket. Il faut alors garder précieusement ces tickets et à la close additionner tous les tickets EMV entre eux et tous les tickets CLESS entre eux pour les rentrer dans RMS.', '', 2),
(2, 'CB', 'yes', 1, 'BEE1F7F4-303E-49EC-ACD0-0F5C85D68B30', 'Sur le TPE, appuyer sur "F" puis "CB EMV" puis "APPEL". Puis "F" puis "CB CLESS" puis "APPEL". Inscrivez le total des transactions. Attention, il peut y avoir un autre ticket pour le même jour dans le tiroir caisse, il est à additionner.', '', 3),
(2, 'CB', 'yes', 1, 'BEE1F7F4-303E-49EC-ACD0-0F5C85D68B30', 'Sur le TPE, appuyer sur "F" puis "CB EMV" puis "APPEL". Puis "F" puis "CB CLESS" puis "APPEL". Inscrivez le total des transactions. Attention, il peut y avoir un autre ticket pour le même jour dans le tiroir caisse, il est à additionner.', '', 4),
